// File: client/src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';

// Pages
import LandingPage from './pages/LandingPage';
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Dashboard from './pages/Dashboard';
import CreateGig from './pages/CreateGig';
import CreateJob from './pages/CreateJob';
import GigDetails from './pages/GigDetails';
import JobDetails from './pages/JobDetails';
import OrderDetails from './pages/OrderDetails';
import Messages from './pages/Messages';
import Conversation from './pages/Conversation';
import Payments from './pages/Payments';
import Profile from './pages/Profile';
import Notifications from './pages/Notifications';

// Components
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import PrivateRoute from './components/PrivateRoute';


function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="min-h-screen flex flex-col">
          <Navbar />
          <main className="flex-grow container mx-auto px-4 py-8">
            <Routes>
              <Route path="/" element={<LandingPage />} />
              <Route path="/home" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />

              {/* Protected Routes */}
              <Route path="/dashboard" element={<PrivateRoute><Dashboard /></PrivateRoute>} />
              <Route path="/create-gig" element={<PrivateRoute><CreateGig /></PrivateRoute>} />
              <Route path="/create-job" element={<PrivateRoute><CreateJob /></PrivateRoute>} />
              <Route path="/gigs/:id" element={<PrivateRoute><GigDetails /></PrivateRoute>} />
              <Route path="/jobs/:id" element={<PrivateRoute><JobDetails /></PrivateRoute>} />
              <Route path="/orders/:id" element={<PrivateRoute><OrderDetails /></PrivateRoute>} />
              <Route path="/messages" element={<PrivateRoute><Messages /></PrivateRoute>} />
              <Route path="/messages/:id" element={<PrivateRoute><Conversation /></PrivateRoute>} />
              <Route path="/payments/:orderId" element={<PrivateRoute><Payments /></PrivateRoute>} />
              <Route path="/profile" element={<PrivateRoute><Profile /></PrivateRoute>} />
              <Route path="/notifications" element={<PrivateRoute><Notifications /></PrivateRoute>} />
            </Routes>
          </main>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
